  [],\n\t\"num_tags\": 0,\n\t\"name\": \"iphc-oceanographic-temperature-salinity-and-other-profile-data-from-the-annual-longline-survey-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The IPHC conducts an annual longline fish
  survey on a 10x10 nautical mile grid from southern Oregon north to the Gulf of Alaska,
  out along the Aleutian Island chain, and into the Bering Sea in depths ranging from
  30 to 500 m. Beginning in 2000, the IPHC conducted a pilot project looking at the
  practicality of collecting oceanographic profile data alongside fishery data at
  the longline survey stations. The project was expanded to stations off Oregon in
  2007 and coast-wide in 2009. Profiles were taken at each station immediately prior
  to hauling the longline gear so that oceanographic data collection is coincident
  with the haul. The data collected are surface to depth profiles of pressure (depth),
  temperature, conductivity (salinity), dissolved oxygen, pH, and chlorophyll-a concentration.\",\n\t\"owner_org\":
